import {useEffect} from 'react'
import Post from "../Post/Post"
import {getPostsOfFollowings} from "../../redux/actions/postAction"
import "./feed.css"

const Feed = ({posts, loading}) => {

    useEffect(() => {
        dispatch(getPostsOfFollowings());
    }, [dispatch])
    return (
        <div>
            <div className="feed">
                {posts && posts.length > 0 ? posts.map((post) => (
                    <Post key={post._id} post={post} loading={loading} />
                )) : <div className="feed">No posts yet</div>}
            </div>
        </div>
    )
}

export default Feed
